import React, { Fragment } from 'react';
import { Container, Jumbotron, Row, Col, Image, Media } from 'reactstrap';

import avaLogo from './../resources/images/avaLogo.png';
import { reactLogo } from './../resources/images/reactLogo.png';

const Landing = (props) => {

    console.log(avaLogo);

    return (
        <Fragment>
            <Jumbotron>
                <Container>
                    <Row>
                        <Col className="text-center">
                            <h1>Avanade Digital Academy - React Me</h1>
                        </Col>
                    </Row>
                    <Row>
                        <Col lg="4">
                            <img src={avaLogo} className="img-fluid" alt="Responsive image"></img>
                        </Col>  
                        <Col lg="8">
                            <p>Welcome to your new single-page application, built with:</p>
                            <ul>
                                <li><a href='https://get.asp.net/'>ASP.NET Core</a> and <a href='https://msdn.microsoft.com/en-us/library/67ef8sbd.aspx'>C#</a> for cross-platform server-side code</li>
                                <li><a href='https://facebook.github.io/react/'>React</a> for client-side code</li>
                                <li><a href='http://getbootstrap.com/'>Bootstrap</a> for layout and styling</li>
                            </ul>
                        </Col>
                    </Row>
                </Container>
            </Jumbotron>
        </Fragment>
    );
};
export default Landing;
